          integrity="sha512-NhSC1YmyruXifcj/KFRWoC561YpHpc5Jtzgvbuzx5VozKpWvQ+4nXhPdFgmx8xqexRcpAglTj9sIBWINXa8x5w=="
          crossorigin="anonymous" referrerpolicy="no-referrer" />
    <style type="text/css">
        html,
        body,
        main {
            width: 100%;
            height: 100%;
        }

        main {
            display: flex;
            align-items: center;
            flex-direction: column;
        }

        .content {
            width: fit-content;
        }

        .toolbar-top {
            display: flex;
            gap: 1rem;
            margin-bottom: 1rem;
            margin-top: 1rem;
            flex-wrap: wrap;
        }

        .toolbar-entity {
            display: flex;
            align-items: center;
            flex-grow: 1;
            flex-basis: 100%;
            gap: 1rem;
        }

        .slider {
            flex: 1;
        }

        #gcode-viewer {
            height: fit-content;
            width: fit-content;
        }
    </style>
</head>

<body>
<script>
    let gcode = "" // set later, so that the big gcode-blob is at the end.

    let travelWidth = 0

    async function render() {
        // First parse the ;TYPE: comments to build an example config for the GCodeRenderer.
        // Note that the example gcode does not indicate travel moves easily -> just ignore that fact for simplicity.

        const TRANSPARENT_COLOR = new gcodeViewer.Color()

        const INNER_COLOR = new gcodeViewer.Color('#ff0000')
        const OUTER_COLOR = new gcodeViewer.Color('#00ff00')
        const SKIRT_COLOR = new gcodeViewer.Color('#ffff00')
        const FILL_COLOR = new gcodeViewer.Color('#ffff00')
        const BOTTOM_FILL_COLOR = new gcodeViewer.Color('#ffff00')
        const INTERNAL_FILL = new gcodeViewer.Color('#00ffff')
        const TOP_FILL = new gcodeViewer.Color('#ff00ff')
        const DEFAULT_COLOR = new gcodeViewer.Color('#0000ff')
        let colorConfig = []

        gcode.split("\n").forEach(function (line, i) {
            let color
            if (line.startsWith(";TYPE:WALL-INNER")) {
                color = INNER_COLOR
            } else if (line.startsWith(";TYPE:WALL-OUTER")) {
                color = OUTER_COLOR
            } else if (line.startsWith(";TYPE:SKIRT")) {
                color = SKIRT_COLOR
            } else if (line.startsWith(";TYPE:FILL")) {
                color = FILL_COLOR
            } else if (line.startsWith(";TYPE:BOTTOM-FILL")) {
                color = BOTTOM_FILL_COLOR
            } else if (line.startsWith(";TYPE:INTERNAL-FILL")) {
                color = INTERNAL_FILL
            } else if (line.startsWith(";TYPE:TOP-FILL")) {
                color = TOP_FILL
            }

            if (colorConfig.length === 0 || color && colorConfig[colorConfig.length - 1].color !== color) {
                colorConfig.push({toLine: i, color})
            } else {
                colorConfig[colorConfig.length - 1].toLine = i
            }
        });

        const renderer = new gcodeViewer.GCodeRenderer(gcode, 800, 600, new gcodeViewer.Color(0x808080))

        // This is an example using the Speed colorizer.
        // Other options are:
        // * SimpleColorizer (default) - sets all lines to the same color
        // * SpeedColorizer - colorizes based on the speed / feed rate
        // * TempColorizer - colorizes based on the temperature
        renderer.colorizer = new gcodeViewer.LineColorizer(colorConfig)

        renderer.travelWidth = travelWidth

        const viewerRef = document.getElementById("gcode-viewer")
        viewerRef.innerHTML = ""
        viewerRef.append(renderer.element())

        await renderer.render()

        // set ui elements
        const slider = document.getElementById("toolbar-slider")
        slider.max = renderer.layerCount().toString()
        slider.value = slider.max
        slider.oninput = (e) => {
            if (!renderer) {
                return
            }

            renderer.sliceLayer(0, Number.parseInt(e.target.value))
        }

        const travelWidthInput = document.getElementById("travel-width")
        travelWidthInput.value = travelWidth
        travelWidthInput.oninput = (e) => {
            if (!renderer) {
                return
            }

            travelWidth = e.target.value
        }

        document.getElementById("rerender").onclick = () => {
            render()
        }

        console.log("rendering finished")
    }

</script>

<main>
    <div class="content">
        <div class="toolbar-top">
            <div class="toolbar-entity">
                Travel Width:
                <input type="number" id="travel-width" />
                <button type="button" id="rerender">Render</button>
            </div>
            <div class="toolbar-entity">
                Layer:
                <input id="toolbar-slider" class="slider" type="range" min="1" max="1" min="1" value="1" />
            </div>
        </div>
        <div id="gcode-viewer"></div>
    </div>
</main>
